HELPFRAME_REPORT_PLAYER_TEXT1 = "World of Warcraft debería ser siempre un entorno divertido, justo y seguro. Si encuentras a un jugador que está usando un |cffffd200nombre ofensivo|r, |cffffd200enviando spam|r en el chat, |cffffd200haciendo trampas|r o usando un |cffffd200lenguaje grosero|r, existe una forma rápida y fácil de informar del problema a Blizzard para que haga un seguimiento.\n\nPara informar de un jugador por no respetar las normas o tener un comportamiento ofensivo, |cffffd200haz clic derecho en el nombre del jugador|r en el chat o |cffffd200haz clic derecho en el retrato del jugador|r y elige la opción |cffffd200Informar de jugador|r.";
