TUTORIAL12 = "Para recuperar maná más rápido puedes beber. Haz |cffffd200clic derecho|r sobre una bebida para bebértela.|n|nSi tu clase no usa maná, no necesitas beber.";
TUTORIAL13 = "Para aprender nuevos talentos existe una interfaz especial.|n|nAbre la página de talentos haciendo clic sobre el |cffffd200botón de talentos|r intermitente de tu barra de acción.";
TUTORIAL14 = "Puedes dirigirte a tu instructor de clase para aprender nuevas habilidades. Haz |cffffd200clic derecho|r en un instructor para hablar con él.|n|nLos instructores se encuentran en muchos pueblos o ciudades y también en tu zona de inicio. Quizá debas buscar un poco para encontrar al instructor que buscas.";
TUTORIAL15 = "Puedes mover hechizos y facultades a tu barra de acción pulsando el |cffffd200botón del libro de hechizos y facultades|r que se encuentra en la parte inferior central de la pantalla y luego arrastrando el icono de la facultad hasta tu barra de acción.|n|nTambién puedes usar un hechizo o una facultad directamente desde el libro de hechizos haciendo clic en él.";
TUTORIAL16 = "Puedes ver tu reputación con los diferentes grupos del mundo desde la pestaña de reputación.|n|nHaz clic en el |cffffd200botón de información de personaje|r para ver la pestaña de reputación.";
TUTORIAL17 = "Para responder a un jugador, pulsa la tecla R y escribe el mensaje, o escribe /contar <nombrejugador> y después el mensaje.";
TUTORIAL18 = "Puedes invitar a otros jugadores a unirse a tu grupo haciendo |cffffd200clic derecho|r sobre su retrato y seleccionando la opción |cffffd200Invitar|r del menú emergente.|n|nPuedes dejar un grupo haciendo clic derecho sobre tu retrato y seleccionando la opción para dejar el grupo.";
TUTORIAL19 = "Esa es otra persona de verdad jugando con su personaje. Te puedes dar cuenta de ello porque su nombre está en azul.";
TUTORIAL1_DWARF = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Joren Cargacero|r.|n|nPara hablar con |cffffd200Joren Cargacero|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_GNOME = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Nevin Tuercellave|r.|n|nPara hablar con |cffffd200Nevin Tuercellave|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_HUMAN = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con el |cffffd200alguacil McBride|r.|n|nPara hablar con el |cffffd200alguacil McBride|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_NIGHTELF = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Ilthalaine|r.|n|nPara hablar con |cffffd200Ilthalaine|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_ORC = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Kaltunk|r.|n|nPara hablar con |cffffd200Kaltunk|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_SCOURGE = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Agatha|r.|n|nPara hablar con |cffffd200Agatha|r tienes que |cffffd200hacer clic derecho|r sobre ella.";
TUTORIAL1_TAUREN = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con el |cffffd200jefe Viento de Halcón|r.|n|nPara hablar con el |cffffd200jefe Viento de Halcón|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_TROLL = "Los asignadores de misiones tienen puntos de exclamación (\124TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0\124t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Jin'thala|r.|n|nPara hablar con |cffffd200Jin'thala|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL2 = "Usa las teclas A, S, D y W para mover a tu personaje.";
TUTORIAL20 = "Si haces |cffffd200clic derecho|r sobre un objeto en la ventana de un vendedor, comprarás ese objeto siempre que tengas dinero suficiente.|n|nSi tienes la ventana del vendedor abierta, al hacer clic derecho en un objeto de tu mochila éste se venderá.";
TUTORIAL21 = "Para ver tus misiones haz clic en el |cffffd200botón de registro de misiones|r, que se encuentra en la parte inferior central de la pantalla.|n|nPara ver las zonas de las misiones, haz clic en el |cffffd200botón del mapa del mundo|r de la parte superior derecha de la pantalla.";
TUTORIAL22 = "Si has disfrutado jugando con otro jugador, añádelo a tu lista de amigos. Haz clic en el |cffffd200botón Social|r y añádelo a tu lista de amigos.|n|nSolo puedes añadir amigos de tu mismo reino.";
TUTORIAL23 = "Para enviar un mensaje pulsa la tecla Intro, escribe algo y vuelve a pulsar Intro. Los jugadores que estén cerca oirán lo que digas.";
TUTORIAL24 = "Para equipar objetos, primero haz clic en el |cffffd200botón de información de personaje|r cerca de la parte inferior de la pantalla, y luego en el |cffffd200botón de la mochila|r del extremo inferior derecho de la pantalla.|n|nDespués, arrastra un objeto para equipar desde la mochila a tu personaje.";
TUTORIAL25 = "Ahora eres un fantasma. Podrás volver a la vida si encuentras tu cuerpo o si te diriges a un ángel de la Resurrección que esté cerca.|n|nTu cadáver se muestra como un icono en el minimapa de la esquina superior derecha de la pantalla.";
TUTORIAL26 = "No sientes cansancio. Esto te otorga un bonus temporal de experiencia cuando matas monstruos.";
TUTORIAL27 = "Cuando te sumerjas en aguas profundas e ignotas aparecerá una barra de fatiga. Cuando esa barra se vacíe, comenzarás a ahogarte.";
TUTORIAL28 = "Nadar es como caminar, excepto por la posibilidad de ir hacia arriba o abajo pulsando el |cffffd200botón derecho del ratón|r y mirando en la dirección que quieres seguir.";
TUTORIAL29 = "Cuando tu personaje se sumerja en el agua, aparecerá la barra Aire. Si te quedas sin aire, comenzarás a ahogarte.";
TUTORIAL3 = "Puedes girar a tu personaje si |cffffd200mantienes pulsado el botón derecho del ratón|r y lo mueves.|n|nPuedes girar la vista de la cámara si mantienes pulsado el botón izquierdo del ratón y lo mueves.";
TUTORIAL30 = "Tu retrato brilla en color amarillo, así que estás descansando. El tiempo que pases descansando o desconectado te da un bonus temporal de experiencia al matar monstruos.|n|nPara volver rápidamente a la taberna a descansar puedes usar tu piedra de hogar.";
TUTORIAL31 = "Las piedras de hogar se pueden usar para teletransportarte de tu ubicación actual a la última posada en la que hayas fijado tu piedra de hogar.";
TUTORIAL32 = "Te estás enzarzando en combate Jugador contra Jugador. En este modo de combate, aparecerá un símbolo de tu alianza al lado de tu retrato y los jugadores enemigos te podrán atacar.";
TUTORIAL33 = "Pulsa la |cffffd200barra espaciadora|r para que tu personaje salte. Salta para superar obstáculos o simplemente para divertirte.";
TUTORIAL34 = "¡FELICIDADES! ¡Acabas de completar tu primera misión!";
TUTORIAL35 = "Este es un maestro de vuelo, que doma criaturas voladoras para el transporte de pasajeros de un lugar a otro. Por una módica suma, podrás volar rápidamente hasta otros maestros de vuelo con los que hayas interactuado anteriormente.|n|nCuando descubras nuevas ciudades, busca a los maestros de vuelo para poder llegar allí volando rápidamente en futuras ocasiones.";
TUTORIAL36 = "Uno de tus objetos está perdiendo durabilidad. El icono de personaje situado debajo del minimapa muestra en amarillo el objeto dañado.|n|nBusca a un vendedor local para repararlo antes de que se rompa.";
TUTORIAL37 = "¡Uno de tus objetos se ha roto! El icono de la armadura, debajo del minimapa, indica el objeto roto en color rojo.|n|nPara repararlo, acude a algún mercader en una aldea. Hasta que no lo hagas, no sacarás partido alguno de ese objeto.";
TUTORIAL38 = "Tu personaje puede aprender profesiones como cocina o herrería que te ayudarán a encontrar o crear valiosos objetos.|n|nSi quieres aprender más sobre las profesiones, pregúntale a un guardia de una ciudad importante cómo llegar hasta los instructores.";
TUTORIAL39 = "Puedes invitar a otros jugadores a unir fuerzas contigo para derrotar a enemigos con más facilidad.|n|nMuchas misiones difíciles se completan fácilmente en grupo y el crédito de la misión se divide entre sus miembros. Además, los grupos ganan bonus de experiencia que los jugadores en solitario no.";
TUTORIAL40 = "¡Has aprendido un hechizo o una facultad nueva! Usa el botón del |cffffd200libro de hechizos y facultades|r que encontrarás en la parte inferior de la pantalla para abrir el libro de hechizos. Haz |cffffd200clic izquierdo y arrastra|r un hechizo o una facultad para moverlo a la barra de acción.|n|nEl libro de hechizos está organizado de tal forma que los hechizos pasivos van después de los activos.";
TUTORIAL41 = "Has aceptado una misión de élite. Estas misiones se resuelven mejor en grupo, ya que te llevarán a regiones habitadas por criaturas de élite también.|n|nLas criaturas de élite son bastante más fuertes que los monstruos normales. Sin embargo, también ganarás más experiencia si las derrotas. Reconocerás a una criatura de élite por el marco dorado de dragón que rodea su retrato.";
TUTORIAL42 = "Como primer paso, deberías empezar con una |cffffd200misión|r.|n|nTienes a un asignador de misiones justo delante. Los consejos de ayuda te irán guiando poco a poco.|n|nMuchas gracias por jugar. ¡Te deseamos buena suerte en tus aventuras!";
TUTORIAL43 = "Un asignador de misiones con un signo '!' gris sobre la cabeza tiene una misión para la que se requiere un nivel superior al tuyo. Vuelve a intentarlo cuando hayas ganado algunos niveles.";
TUTORIAL44 = "Te has hecho con un arma a distancia. Para usarla debes equiparla (abre la |cffffd200Información del personaje|r y la |cffffd200Mochila|r y arrastra el objeto hasta tu personaje).|n|nDespués, abre tu |cffffd200Libro de hechizos|r y arrastra la facultad |cffffd200Disparar|r o |cffffd200Lanzar|r a tu barra de acción.|n|nTan solo los cazadores, guerreros y pícaros pueden usar armas a distancia, mientras que los magos, sacerdotes y brujos pueden usar varitas.";
TUTORIAL45 = "No puedes disparar arcos o armas de fuego sin munición. Para comprar munición, busca a un vendedor de arcos o armas de fuego en la ciudad. Para cargar la munición, haz |cffffd200clic derecho|r sobre ella.";
TUTORIAL46 = "Te has unido a una banda: es un grupo con un límite superior de hasta 40 personas, aunque suelen ser de 10 o de 25. Las bandas se necesitan para acceder a los calabozos más desafiantes o para derrotar a los enemigos más poderosos, generalmente a niveles altos.|n|n|cffff2020Mientras estés en una banda, no se validarán los objetivos de la mayoría de las misiones. Para dejar una banda, haz clic derecho sobre el retrato de tu personaje y selecciona Dejar el grupo.|r";
TUTORIAL47 = "¡Has conseguido acceder a la barra de tótems! Cada vez que accedas a un elemento nuevo de tótem obtendrás un botón de acción en esta barra. |n|nLa barra puede contener un hechizo de tótem por cada elemento. Cuando llegues a mayor nivel ganarás la facultad de lanzar varios tótems a la vez.";
TUTORIAL48 = "Te has unido a una cola para entrar a un campo de batalla. Para ver el estado, pasa el cursor del ratón por encima del icono en tu minimapa.";
TUTORIAL49 = "Ahora puedes unirte a la batalla. Haz clic en \"Ir a la batalla\", en el cuadro de diálogo o clic derecho en el icono del campo de batalla en el minimapa.";
TUTORIAL4_DWARF = "Los |cffffd200invasores Comepiedras|r están cerca. |cffffd200Haz clic izquierdo|r en cualquier |cffffd200invasor Comepiedras|r para seleccionarlo.";
TUTORIAL4_GNOME = "Los |cffffd200gnomos parias enloquecidos|r están cerca. |cffffd200Haz clic izquierdo|r en cualquier |cffffd200gnomo paria enloquecido|r para seleccionarlo.";
