TUTORIAL51 = "Puedes entrar en calabozos o buscar grupos para calabozos mediante el |cffffd200buscador de calabozos|r. Puedes acceder a este buscador desde el botón con forma de ojo que está en el medio de tu barra de acción.";
TUTORIAL52 = "Enhorabuena, has recibido tu primer compañero. Este amiguito te seguirá en todas tus aventuras por las tierras de Azeroth y más allá.|n|nPuedes ver a todos tus compañeros en la pestaña |cffffd200Compañeros|r del |cffffd200botón del libro de hechizos|r.";
TUTORIAL53 = "Enhorabuena, has aprendido a invocar tu primera montura. Este poderoso corcel te llevará de aventura en aventura por las tierras de Azeroth y más allá.|n|nPara ver todas tus monturas, consulta la pestaña |cffffd200Monturas|r dentro del |cffffd200botón del libro de hechizos|r. Podrás arrastrar tu montura favorita a la barra de acción para invocarla con mayor facilidad.";
TUTORIAL54 = "Has llamado la atención de una criatura hostil.|n|nUn resplandor rojo significa que la criatura te está atacando a ti. Un resplandor amarillo significa que estás en peligro de ser atacado. Un resplandor naranja significa que la criatura te está atacando a ti pero podría cambiar de objetivo en cualquier momento.";
