TUTORIAL60 = "Recuerda, tu personaje tiene facultades especiales en la barra de acción en la parte inferior de la pantalla.|n|nSi usas estas facultades podrás matar a los enemigos mucho más rápidamente que si te limitas a golpearlos con tu arma.";
