VOICEMACRO_20_Dw_4_FEMALE = "Mi tío tiene las bolas de latón. ¡En serio!";
VOICEMACRO_20_Dw_5 = "Me gusta la cerveza igual que la mujer; con cuerpo y amarga.";
VOICEMACRO_20_Dw_5_FEMALE = "Cada noche me hago la pedicura en una gran olla. No tengo ni un hongo. Tengo los pies inmaculados.";
VOICEMACRO_20_Dw_6 = "Yo no soy un alcohólico anónimo. Todo el mundo me conoce y no me escondo para beber.";
VOICEMACRO_20_Gn_0 = "¿Sabes? Me encantaría tener un jardín donde colocar un par de estatuas de humanos.";
VOICEMACRO_20_Gn_0_FEMALE = "Pido disculpas por cualquier inconveniente que pueda haber ocasionado la matanza en la que me he visto envuelta.";
VOICEMACRO_20_Gn_1 = "Creo que ando corto de cambio. Vale, ¡este es muy malo!";
VOICEMACRO_20_Gn_1_FEMALE = "He descubierto que una somanta de palos puede resultar bastante dolorosa.";
VOICEMACRO_20_Gn_2 = "Espero encontrar algunos artilugios interesantes por aquí. Me encanta trastear con cacharros.";
VOICEMACRO_20_Gn_2_FEMALE = "Ya sabes que una ardilla acorralada puede resultar mortal.";
VOICEMACRO_20_Gn_3 = "Diseñé un aparato para meter rebanadas de pan y tostarlas, pero he pensado que en realidad nadie usaría una cosa así.";
VOICEMACRO_20_Gn_3_FEMALE = "Ojalá encuentre la gallina de los huevos de oro algún día.";
VOICEMACRO_20_Gn_4 = "Me gustaría saludar a mis colegas de Gnomeregan. Gran-T, Fisgón y Pequeño Dees... sois la leche. Pequeños, pero la leche.";
VOICEMACRO_20_Gn_5 = "Si me miro en un espejo de aumento, parezco mucho más grande.";
VOICEMACRO_20_Hu_0 = "Cúbreme. Me escabulliré detrás de un árbol.";
VOICEMACRO_20_Hu_0_FEMALE = "¿Por qué todo el mundo piensa enseguida que sé coser y cocinar?";
VOICEMACRO_20_Hu_1 = "Un orco entra en un bar con un loro sobre el hombro. El barman le dice: \"Oye, ¿de dónde has sacado esa cosa?\". Y el loro le responde: \"De Durotar. Allí hay muchos\".";
VOICEMACRO_20_Hu_1_FEMALE = "¿Alguna vez has tenido la sensación de no controlar tu destino? Es como si te controlase una mano invisible.";
VOICEMACRO_20_Hu_2 = "Un pato entra en una botica y dice: \"Una tirita, por favor, que me he caído.\" Y le contesta el boticario: \"Pues menuda mala pata.\"";
VOICEMACRO_20_Hu_2_FEMALE = "¡A veces no CONTROLO EL VOLUMEN DE MI VOZ!";
VOICEMACRO_20_Hu_3 = "¿Cómo se esconde un tauren en un cerezo? Se pinta las pezuñas de rojo.";
VOICEMACRO_20_Hu_3_FEMALE = "Me gusta tirarme pedos en la bañera.";
VOICEMACRO_20_Hu_4 = "Un tipo se me acercó y dijo: \"Soy un tipi, soy un wigwam, soy un tipi, soy un wigwam.\" Y yo le contesté: \"Relájate, tío, estás demasiado tenso.\"";
VOICEMACRO_20_Hu_4_FEMALE = "Mis amigas y yo nos intercambiamos la ropa. Todas llevamos la misma talla.";
VOICEMACRO_20_Hu_5 = "\"Tengo una gran idea para una película. Se trata de dos gnomos que encuentran un poderoso brazalete y tienen que llevarlo hasta las Estepas Ardientes y lanzarlo a La Caldera. Forman la Hermandad del Brazalete. Durante el camino un múrloc llamado Gottom, obsesionado con el brazalete, los sigue. También nueve hombres del saco que se lo quieren robar. Podríamos hacer una trilogía y llamarla \"El Soberano del Brazalete\". La primera parte podría llamarse \"La Hermandad del Brazalete\", seguida de \"Un Par de Torres\", con el culminante final \"Eh, el Rey ha vuelto\".";
VOICEMACRO_20_Hu_5_FEMALE = "Necesito una pedicura con urgencia.";
VOICEMACRO_20_Hu_6_FEMALE = "Qué ganas tengo de acabar esta misión y poder buscar otro objeto Garibaldi.";
VOICEMACRO_20_Ni_0 = "Anoche estuve en una estupenda fiesta exclusiva para tíos.";
VOICEMACRO_20_Ni_0_FEMALE = "¿Sabes? No puedo dejar de moverme ni por la noche o desaparezco.";
VOICEMACRO_20_Ni_1 = "¿Sabes? Esos Protectores ancestrales de Darnassus no son tan viejos.";
VOICEMACRO_20_Ni_1_FEMALE = "La verdad es que soy más bien una elfa de la mañana.";
VOICEMACRO_20_Ni_2 = "Estaba en medio del Sueño Esmeralda cuando me entraron ganas de mear.";
VOICEMACRO_20_Ni_2_FEMALE = "¿Sabes? Los fuegos fatuos son bastante útiles para la higiene personal.";
VOICEMACRO_20_Ni_3 = "¿Eso está afilado? ¿Podría cortarme? Ahora no soy inmortal, ¿sabes?";
VOICEMACRO_20_Ni_3_FEMALE = "Creo que los tíos solo usan el Sueño Esmeralda como una excusa para no volver a llamarme.";
VOICEMACRO_20_Ni_4 = "No sé tú, pero yo no entiendo ni una palabra de lo que dicen los fuegos fatuos. Asiento y punto.";
VOICEMACRO_20_Ni_4_FEMALE = "Ya estoy bailando de nuevo. Espero que tus amigos disfruten del espectáculo.";
VOICEMACRO_20_Ni_5 = "¿Quién quiere vivir eternamente?";
VOICEMACRO_20_Ni_6 = "¿Cómo? No te he oído.";
VOICEMACRO_20_Ni_7 = "No me molestan los gnomos, pero siempre pienso que me voy a tropezar con uno.";
VOICEMACRO_20_Or_0 = "Aplastaré y destruiré y… Ummm, qué gustito.";
VOICEMACRO_20_Or_0_FEMALE = "Ponte entre mi comida y yo, y perderás una mano.";
VOICEMACRO_20_Or_1 = "No es fácil ser verde.";
VOICEMACRO_20_Or_1_FEMALE = "La gente con piercings pequeños no me inspira respeto. Creo que hay que ir a por todas… ¡como clavándote una lanza en medio de la cabeza!";
VOICEMACRO_20_Or_2 = "Jo, tío, es como que me siento tú, pero no me siento tú... ¿Entiendes?";
VOICEMACRO_20_Or_2_FEMALE = "Yo me veo muy femenina y le partiré las piernas a cualquiera que diga lo contrario.";
VOICEMACRO_20_Or_3 = "Vengo de los orcos. Comemos con cucharas y tenedores y nos encanta comer cerdo.";
VOICEMACRO_20_Or_3_FEMALE = "¿Qué son los estrógenos? ¿Se comen?";
VOICEMACRO_20_Or_4 = "¡Golpe orco!";
VOICEMACRO_20_Or_4_FEMALE = "Tengo que hacerme la cera en el pecho de nuevo.";
VOICEMACRO_20_Or_5 = "¡Deja de darme! Bueno, te vas a enterar.";
VOICEMACRO_20_Or_5_FEMALE = "Creo que este pedazo de jabalí se me viene encima otra vez. Yo me largo. ¿Alguien tiene una piedra de hogar por casualidad?";
VOICEMACRO_20_Sc_0 = "No soporto el olor de los orcos.";
VOICEMACRO_20_Sc_0_FEMALE = "Me pintaría las uñas, pero es que no las encuentro.";
VOICEMACRO_20_Sc_1 = "Estoy muerto y estoy harto.";
VOICEMACRO_20_Sc_1_FEMALE = "Sí, son reales. No me pertenecen, pero son reales.";
VOICEMACRO_20_Sc_2 = "Las rosas son grises, las violetas también. Estoy muerto y soy daltónico.";
VOICEMACRO_20_Sc_2_FEMALE = "Hoy huelo a perro muerto.";
VOICEMACRO_20_Sc_3 = "Menuda estafa, mocos y babas, el cadáver se hundió en la laguna. El múrloc dijo \"Ahhh…\" ante tal imagen y el enano le dio un azote al babuino.";
VOICEMACRO_20_Sc_3_FEMALE = "Esto apesta.";
VOICEMACRO_20_Sc_4 = "¿Tienes desodorante? Me valen las fragancias \"perro mojado\", \"basura fresca\" o \"marea baja\".";
VOICEMACRO_20_Sc_4_FEMALE = "¿Sabes? Cuando estás muerto, ya nada huele mal. ¿Huevos podridos? No hay problema. ¿Pescado muerto? Como una brisa de primavera.";
VOICEMACRO_20_Sc_5_FEMALE = "Si no tienes axilas, no te hace falta desodorante.";
VOICEMACRO_20_Sc_6_FEMALE = "Ah, clavos de ataúd.";
VOICEMACRO_20_Sc_7_FEMALE = "La verdad es que soy tan graciosa que a veces me parto yo sola.";
VOICEMACRO_20_Ta_0 = "Juega con un toro y terminarás viendo sus cuernos de cerca.";
VOICEMACRO_20_Ta_0_FEMALE = "En mi idioma, mi nombre significa bailando con bolas.";
VOICEMACRO_20_Ta_1 = "Aquí está la carne.";
VOICEMACRO_20_Ta_1_FEMALE = "Una vez me reí tan fuerte que pringué todo el suelo de leche.";
VOICEMACRO_20_Ta_2 = "¿Homogeneizado? De eso nada. Me gustan las mujeres.";
VOICEMACRO_20_Ta_2_FEMALE = "Los tauren felices vienen de Mulgore.";
VOICEMACRO_20_Ta_3 = "Ya sabes, los tauren nacen cazadores. ¿Has visto alguna vez a un tauren coger un salmón de un río? Es realmente emocionante. Y... ¿alguna vez has visto a un tauren acechar una serpiente? Por supuesto que no lo has visto. Eso es porque los tauren son expertos en camuflarse con el entorno.";
VOICEMACRO_20_Ta_3_FEMALE = "¿Sabes lo difícil que es sentirse ligero cuando tienes el espíritu de tu tatarabuela sobre la espalda todo el día?";
VOICEMACRO_20_Ta_4 = "Muu. ¿Qué? ¿Te ha gustado?";
VOICEMACRO_20_Tr_0 = "El estofado está listo.";
VOICEMACRO_20_Tr_0_FEMALE = "El mal aliento no es más que uno de mis rasgos femeninos.";
VOICEMACRO_20_Tr_1 = "Me encantan las féminas regordetas, fofas y con halitosis.";
VOICEMACRO_20_Tr_1_FEMALE = "Me siento guapa, muy guapa (escupe).";
VOICEMACRO_20_Tr_2 = "Se me ha encogido la cabeza. Acabo de salir de la piscina.";
VOICEMACRO_20_Tr_2_FEMALE = "Además de lo que ves, tengo una gran personalidad.";
VOICEMACRO_20_Tr_3 = "Un nuevo trol.";
VOICEMACRO_20_Tr_3_FEMALE = "Quizás sea más fácil conquistar a un hombre a través del estómago, pero yo prefiero la caja torácica.";
VOICEMACRO_20_Tr_4 = "Mato dos enanos por la mañana y por la noche otros dos. Mato dos enanos por la tarde y ya me siento mejor. Mato dos enanos en tiempos de paz y otros dos en tiempos de guerra. Mato dos enanos antes de matar dos enanos y justo después otros dos.";
VOICEMACRO_20_Tr_4_FEMALE = "Si el canibalismo está mal, no quiero ser bueno.";
VOICEMACRO_20_Tr_5 = "He oído que si te cortas una extremidad, te sale otra de mayor tamaño. No me lo creo.";
